import React from 'react';
import {Route, Link, Switch} from 'react-router-dom'
import './App.css';
import UpdateProfile from './components/UpdateProfile';

function App() {
  return (
    <div className="App">
      <h1>Hello World</h1>

      <Link to="/updateprofile/787878">Routing Example with best practices</Link><br/>

      <Switch>
          <Route path="/updateprofile/:myID"><UpdateProfile /></Route>        
      </Switch>
      </div>
  );
}

export default App;
